(451, 'ASOCIACION DE CIENCIAS AMBIENTALES', '', '', 'FACULTAD DE CC AMBIENTALES CAMPUS UNIVERSITARIO', '28805', '', '', 'aca@ciencias-ambientales.org', 999000005, 'MEDIOAMBIENTE', 'colectivo', 1999, 'http://www.cienciasambientales.org.es/', 'ACAmbientales', 'ACAmbientales', 'Voluntariado,Ciencias Ambientales,Energía', 'Estudiantes, científicos y técnicos de diferentes disciplinas, preocupados y ocupados en el estudio y la resolución de los problemas ambientales.', '<H2>Información</H2>\r\nEstudiantes, científicos y técnicos de diferentes disciplinas, preocupados y ocupados en el estudio y la resolución de los problemas ambientales.\r\n\r\n<H2>Misión</H2>\r\n• Ser un punto de encuentro y reunión científicos, técnicos y profesionales dedicados al amplio campo de las Ciencias Ambientales para el fomento de la investigación, el intercambio de conocimientos, perspectivas y sensibilidades, la formación de equipos interdisciplinares, el fomento de debates, el desarrollo de iniciativas conjuntas, etc.\r\n\r\n• Ser un actor social catalizador de iniciativas y proyectos entre diferentes sectores de la sociedad (político, económico y social) que fomente la información, la educación, el diálogo, la concertación y la participación de la sociedad en actitudes y actividades que persigan alcanzar modelos de convivencia y de desarrollo más sostenibles.\r\n\r\n<H2>Descripción de la empresa</H2>\r\nLa Asociación de Ciencias Ambientales (ACA), es una entidad sin ánimo de lucro de carácter estatal, fundada en 1997.', 1),
